CREATE TABLE `check_medicine_recommend` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `idx_high` varchar(64) NOT NULL DEFAULT '' COMMENT '风险较高的二项idx',
  `risk_name_high` varchar(64) NOT NULL DEFAULT '' COMMENT '风险较高的二项名称',
  `risk_level_high` tinyint(4) NOT NULL DEFAULT '0' COMMENT '级别',
  `level_high` tinyint(4) NOT NULL DEFAULT '0',
  `idx_low` varchar(64) NOT NULL DEFAULT '' COMMENT '风险较低的二项idx',
  `risk_name_low` varchar(64) NOT NULL DEFAULT '' COMMENT '风险较低的二项名称',
  `risk_level_low` varchar(64) NOT NULL DEFAULT '0' COMMENT '级别',
  `level_low` tinyint(4) NOT NULL DEFAULT '0',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `medicine` varchar(256) NOT NULL DEFAULT '' COMMENT '药品',
  `medicine_info_need` tinyint(4) NOT NULL DEFAULT '0',
  `medicine_info_low_need` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='药品推荐';

LOCK TABLES `check_medicine_recommend` WRITE;
